import './App.css';
import circle from './files/circle.png'

function App() {
  return (
    <div className="Wrapper">
      <div className="GeneralInfo">
        <p> Abhinandan Srinivas </p>
        <p> Software Developer </p>
        <button> Resume </button>
        <a href="#"> GitHub </a>
      </div>
      <div className="Frameworks">
        <p>Frameworks I can work with</p>
        <img src={circle} alt="" style={{"height" : "40px", "width" : "40px"}}></img>
      </div>
    </div>
  );
}

export default App;
